import React from "react";
import ReactDOM from "react-dom";
import './index.css';
import Card from "./Cards";
import Sdata from "./Sdata";
function ncard(val){
    return (<Card
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      mname={Sdata[0].mname}
      link={Sdata[0].link}
    />
    )
}
ReactDOM.render(
  <>
    <h1 className="heading_style"> List of Marvel Movies</h1>


    Sdata.map(ncard);
  </>,
  document.getElementById("root")
);
